import React from 'react'
import { SliderData } from './SliderData';
import '../Images/wildrift.jpg';

export default function ImageSlider() {
    return (
        <div>
            {SliderData.map((slide, index) => {
                return (
                    <img src={slide.image} alt="imagen"/>
                )
            })}
        </div>
    )
}


